  static loadStrokes() {
    const xhr = new XMLHttpRequest();
    xhr.open("GET","/images/svg/strokes/circle_large/circle_large.svg",false);
    xhr.overrideMimeType("image/svg+xml");
    xhr.onload = function(e) {
      Strokes.setStrokes(xhr.responseXML.documentElement)
    }
    xhr.send("");
  }

  static setStrokes(__domSvg) {
    const svg = C.GetBy.id("TEST");
    const path = C.GetBy.selector("path", svg)[0];
    let text = "";

    this.circles_large = [];
    C.ForEach(C.GetBy.selector("path", __domSvg), (item)=> {
      this.circles_large.push({
        time:0,
        path:item.getAttribute("d")
      });
    });

    let i = 0;
    this.circles_large.forEach((e)=> {
      const newpath = document.createElement("path");
      path.setAttribute("d", e.path);
      e.time = Maths.precission(Math.min(this.MAX, Math.max(this.MIN, (path.getTotalLength() * this.TIME) / 1000)),2);

      text += "{time:" + e.time + ", path:'" + e.path + "'},"

      i++;
    });

    console.log(text);
  }

  static getRandomPath(__type) {
    let temp;
    switch(__type) {
      case "square": temp = this.squares; break;
      case "underline": temp = this.underlines; break;
      case "circle": temp = this.circles; break;
      case "circle_large": temp = this.circles_large; break;
      case "cross": temp = this.crosses; break;
    }
    const RANDOM = Maths.maxminRandom(temp.length-1, 0);

    return {path:temp[RANDOM].path, time:temp[RANDOM].time}
  }

  static setPath(__path, __type) {
    const PATH = this.getRandomPath(__type);

    __path.setAttribute("d", PATH.path);
    __path.setAttribute("style", "");

    return PATH.time;
  }
